import React from 'react';
import 'tachyons';

const Rank = () => {
    return (
        <div className="tc">
            <div className="white f3">
                USER, your current rank is
            </div>
            <div className="white f1">
                #RANK
            </div>
            
        </div>
        
    )
}

export default Rank;
